import { AiOutlineThunderbolt, AiOutlineUndo,AiOutlineShrink } from "react-icons/ai";
const CardData = [
    {
        id:1,
        images:"./images/s2.jpg",
        icons:<AiOutlineThunderbolt className="icons"/>,
        Title:"Air Conditioning Designing and Contracting Services",
        discription: "We offer high quality installation of residential & commercial..."
    },
    {
        id:2,
        images:"./images/s1.jpg",
        icons:<AiOutlineUndo className="icons"/>,
        Title:"Ventilation Designing and Contracting Services",
        discription: "We provide a full range of repairing and maintenance of air..."
    },
    {
        id:3,
        images:"./images/s3.jpg",
        icons:<AiOutlineShrink className="icons"/>,
        Title:"HVAC System Designing and Contracting Services",
        discription: "Expound the actual teachings of the great pleasure & praising..."
    },
    {
        id:4,
        images:"https://cdn.pixabay.com/photo/2019/05/12/15/07/electric-4198293_960_720.jpg",
        icons:<AiOutlineThunderbolt className="icons"/>,
        Title:"Annual Maintenance Service",
        discription: "We offer high quality installation of residential & commercial..."
    },
    {
        id:5,
        images:"https://cdn.pixabay.com/photo/2019/02/06/16/32/architect-3979490_960_720.jpg",
        icons:<AiOutlineUndo className="icons"/>,
        Title:"AC Rental Services",
        discription: "We provide a full range of repairing and maintenance of air..."
    },
    {
        id:6,
        images:"https://images.pexels.com/photos/8159/pexels-photo.jpg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940",
        icons:<AiOutlineShrink className="icons"/>,
        Title:"Electrical Projects",
        discription: "Expound the actual teachings of the great pleasure & praising..."
    },
    
]
export default CardData;
